import React from "react";
import { PaymentHeader, PayAccountUser, PayOrderProcess, PayyMenthod, PayNote } from "./PaymentComponents"; 


export default function Payments(){
    return(
        <div className="payment-container">
      <PaymentHeader />
      <div className="payment-content">
        <PayAccountUser />
        <PayOrderProcess />
        <PayyMenthod />
        <PayNote />
      </div>
    </div>
    );
}
